Example :

import Html exposing (..)
import Html.Attributes (..)
import Bulma as B

view =
    div
        [ B.columns ]
        [ div
            [ B.column ]
            [ Html.text "column 1" ]
        , div
            [ B.column ]
            [ Html.text "column 2" ]
        ]


